import FavouriteIndex from "./components/FavouriteIndex";
import Favourite from "./components/Favourite";

function App() {
  return (
    <BrowserRouter> 
      <Routes>
        <Route path="/" element={<MainSearch />} />
        <Route path="/:company" element={<CompanySearchResults />} />

      </Routes>
    </BrowserRouter>
  );
}

export default App;
